import '../ComponentStyles/error.css'

function Error({message}) {
    return (
        message &&
        <div className="error">
            <i class="bi bi-bug-fill"></i>
            <div className='error-message-container'>
                <h6 className='error-text'>{error}</h6>
            </div>
        </div>
    )
}

export default Error;
